import React, {useContext, useEffect, useState} from 'react';
import { createStyles, makeStyles, Theme } from '@material-ui/core/styles';
import InputLabel from '@material-ui/core/InputLabel';
import MenuItem from '@material-ui/core/MenuItem';
import FormHelperText from '@material-ui/core/FormHelperText';
import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';

type StatusSelectorProps = {
    status: string,
    handleChange
}
const StatusSelector:React.FC<StatusSelectorProps> = (props) => {

    return (
        <Select
        value={props.status}
        onChange={props.handleChange}
        label="Status"
        >
        <MenuItem value="">
            <em>None</em>
        </MenuItem>
        <MenuItem value="cancelled">Ten</MenuItem>
        <MenuItem value="processing">Ten</MenuItem>
        <MenuItem value="completed">Twenty</MenuItem>
        <MenuItem value="refunded">Thirty</MenuItem>
        </Select>
    );
}

export default StatusSelector;
